import Greetings from '../../components/greetings';
import Accounts from '../../components/accounts';

import './style.css';


const user = () => {

    const [isLoading, setIsLoding] = useState(true);

    // TODO : 1er truc à faire, on récupère le token de redux, et on tente un fetch pour récupérer les infos du user
    // Si le résultat est OK, alors on affiche la page avec setIsLoading(false)
    // Si le résultat est KO, alors on redirige vers la page connexion

    if(isLoading) {
        return (<p>Chargement en cours..</p>)
    }

    return (
        <div className='backgroundcolor'>
         <Greetings />   
         <Accounts />
        </div>
    );
};

export default user;
